settings.markerImageFunction:
var type = dsData[dsIndex]['Type'];
if (type == 'thermometer') {
	var res = {
	    url: images[0],
	    size: 40
	}
	var temperature = dsData[dsIndex]['temperature'];
	if (typeof temperature !== undefined) {
	    var percent = (temperature + 60)/120;
	    var index = Math.min(3, Math.floor(4 * percent));
	    res.url = images[index];
	}
	return res;
}

headerButton.customFunction:
let stateIndex = widgetContext.stateController.getStateIndex();
if (stateIndex > 0) {
    stateIndex -= 1;
    backToPrevState(stateIndex);
}

function backToPrevState(stateIndex) {
    widgetContext.stateController.navigatePrevState(stateIndex);
}

